import React from "react";
import "./Homepage.css";

export default function Home() {
  return (
    <div className="Home">
      <div className="lander">
        <h1>Welcome to the Vaccine Passport</h1>
        <p className="text-muted">Sign up or log in to get started.</p>
      </div>
    </div>
  );
}
